import React from "react";

const Projects = () => {
    return (
        <div class="px-10 flex flex-col">
            <button class="bg-pink-555 rounded-full py-2 mx-20 my-5" style={{'color':'white'}}><a href="https://github.com/MiriamNM">⭐️ GitHub Profile</a></button>
            <button class="bg-pink-555 rounded-full py-2 mx-20 my-5" style={{'color':'white'}}><a href="https://github.com/MiriamNM/99minutos-frontend-interview-test-2/tree/JR-miriamnava/space-land">⭐️ Technical test 99minutos</a></button>
            <button class="bg-pink-555 rounded-full py-2 mx-20 my-5" style={{'color':'white'}}><a href="https://github.com/MiriamNM/Eight-queens-puzzle">⭐️ Technical test Cuenca, Eight-queens-puzzle</a></button>
            <button class="bg-pink-555 rounded-full py-2 mx-20 my-5" style={{'color':'white'}}><a href="https://github.com/Jael91/CDMX010-burger-queen-api-client">⭐️ CDMX010-burger-queen-api-client</a></button>
            <button class="bg-pink-555 rounded-full py-2 mx-20 my-5" style={{'color':'white'}}><a href="https://github.com/MiriamNM/CDMX010-md-links">⭐️ CDMX010-md-links</a></button>

        </div>   
    )
};

export default Projects;
